import { useState } from "react";
const Dashboard = () => {
  const [isOnline, setIsOnline] = useState(true);
  const changName = () => {
    setIsOnline(!isOnline);
  };
  return (
    <>
      <h1>Dashboard</h1>
      <p className={`${isOnline ? "online3" : "  offline3"}`}>sunny</p>
      <button onClick={changName}>v</button>
    </>
  );
};

export default Dashboard;
